import React from "react";

import { Route, Link, useHistory } from "react-router-dom";
import { makeStyles } from "@material-ui/core/styles";

import Login from "./Login";
import Post from "./Post";
import Put from "./Put";
import Delete from "./Delete";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  }
}));
function Admin(props) {
  let path = `${props.history}`;
  console.log(path);
  // const classes = useStyles();
  // if (match.path.include("/admin") === true) props.isAdminOpen();
  // else props.isAdminClose();

  return (
    <>
      <Route path="/admin" exact component={Login}></Route>
      <Route path="/admin/post" component={Post}></Route>
      <Route path="/admin/put" component={Put}></Route>
      <Route path="/admin/delete" component={Delete}></Route>
    </>
  );
}

export default Admin;
